import './HomeLayoutStyles.css'
import PropTypes from 'prop-types'

class HomeLayout extends Component {
  constructor() {
    super()
    this.state = {
    }
  }

  render() {
    return (
      <div className="HomeContainer">
        <div className="InnerHomeContainer">
          <ul>
            <p className="WhatWeOffer">What We Offer:</p>
            <li>Timesheet submittal</li>
            <li>Store timesheets and their history in the cloud</li>
            <li>Send an email update to the company's admin</li>
          </ul>
          <p className="SignUp">Sign Up as an admin and register your employees to get started...</p>
        </div>
      </div>
    )
  }
}

